// import { useState, useEffect } from "react";
import React from "react";
import GetData from "../service/logementService";
import "../styles/Accueil.css";
import Banner from "../components/Banner";
import { useNavigate } from "react-router-dom";

function Accueil({ houses }) {
  return (
    <section>
      <div>
        <Banner />
      </div>
      <div className="logements_container">
        <article className="logements_card">
          {houses.map((location, index) => (
            <div className="logement_et_titre" key={index}>
              <p>{location.title}</p>
              <img
                className="accueil_img"
                src={location.cover}
                alt="logements"
              />
            </div>
          ))}
        </article>
      </div>
    </section>
  );
}
export default Accueil;
